import React, { useEffect, useRef } from 'react';
import styles from './Jumbotron.module.css';
import { TimelineMax } from 'gsap';

const Jumbotron = () => {
	const profilePictureContainer = useRef(null);
	const profilePicture = useRef(null);
	const profileOutline = useRef(null);
	const borderProfile = useRef(null);
	let tl = new TimelineMax({
		defaults: { duration: 0.7, opacity: 0 },
	});

	let tl2 = new TimelineMax({
		defaults: {
			duration: 6,
			delay: 1,
			alternate: true,
		},
	});

	useEffect(() => {
		tl.from(
			profilePictureContainer.current,
			{ delay: 1, scale: 0.2, transformOrigin: 'center' },
			'=.2'
		);
		tl.from(profilePicture.current, { y: 40 });
		tl.from(profileOutline.current, { width: 10 });
		tl.from(borderProfile.current, { opacity: 0, transformOrigin: 'center' });
		tl2.to(borderProfile.current, {
			rotate: 180,
			transformOrigin: 'center',
			repeat: -1,
			yoyo: true,
			strokeDasharray: 10,
			stroke: '#cd486b',
		});
	}, [tl, tl2]);

	return (
		<div className={styles.jumbotronContainer}>
			<div className={styles.jumbotronContentContainer}>
				<div className={styles.profileWithCircles}>
					<svg
						width="420"
						height="420"
						viewBox="0 0 420 420"
						fill="none"
						xmlns="http://www.w3.org/2000/svg"
						className={styles.SvgCircles}
					>
						<circle
							cx="210"
							cy="210"
							r="207.5"
							stroke="#8a3ab9"
							stroke-dashoffset="0"
							stroke-width="7"
							stroke-linecap="round"
							stroke-linejoin="round"
							stroke-dasharray="1"
							className={styles.borderProfile}
							ref={borderProfile}
						/>
					</svg>
					<div
						className={styles.profilePictureContainer}
						ref={profilePictureContainer}
					>
						<svg
							width="373"
							height="409"
							viewBox="0 0 373 409"
							fill="none"
							xmlns="http://www.w3.org/2000/svg"
							xmlnsXlink="http://www.w3.org/1999/xlink"
							className={styles.profilePicture}
							ref={profilePicture}
						>
							<rect width="373" height="409" fill="url(#pattern0)" />
							<path
								className={styles.profileOutline}
								ref={profileOutline}
								d="M40.5 315C22.1 314.2 8.5 324 4 329V405.5H366.5V275H356C346.4 270.2 335.667 272 331.5 273.5C308.7 281.1 280 274.333 268.5 270C248.5 261.6 244.833 237.833 245.5 227C244.7 211 254.5 199.667 259.5 196V183.5C269.9 183.5 277.833 175.833 280.5 172C280.5 168 283.833 159.667 285.5 156C288.7 147.2 283.5 139 280.5 136L281.5 130C289.5 118.4 284.833 101.833 281.5 95C281.9 68.2 263 46.5 253.5 39C235.9 27 211.833 24 202 24C184.8 8.79999 176.833 19 175 26C172.6 40.8 163 40.8333 158.5 39C137.7 29.8 124.5 47.8333 120.5 58L112 80C108.8 95.2 112.333 110.667 114.5 116.5L114 141.5C110.8 142.7 108.333 147.333 107.5 149.5V167C111.5 169.8 116.167 177.833 118 181.5V187.5L128 197C147.6 210.2 150.5 240.167 149.5 253.5C149.9 270.7 142 280.333 138 283C127.6 282.2 122.333 282.667 121 283L119.5 284L108.5 291.5C101.7 300.3 89 306.167 83.5 308C72.3 307.6 63.5 308.833 60.5 309.5C54.1 312.7 44.5 314.5 40.5 315Z"
								stroke="white"
								stroke-width="5"
							/>
							<defs>
								<pattern
									id="pattern0"
									patternContentUnits="objectBoundingBox"
									width="1"
									height="1"
								>
									<use
										xlinkHref="#image0"
										transform="translate(0.0104884 -0.586797) scale(0.00259643 0.00236789)"
									/>
								</pattern>
								<image
									id="image0"
									width="375"
									height="666"
									xlinkHref="data:image/png;base64,"
								/>
							</defs>
						</svg>
					</div>
				</div>

				<div className={styles.jumbotronTextContainer}>
					<h1>Welcome.</h1>
					<p>
						{' '}
						<span>I am Galih Permana</span>, a frontend developer from
						Batam. Currently{' '}
						<span>
							studying Computer Engineering in Brawijaya University
						</span>
						. Having interest in website development, network engineering,
						and football.
					</p>
					<div className={styles.linksContainer}>
						<div className={styles.aContainer}>
							<a href="">Readme</a>
						</div>
						<div style={{ fontWeight: 600 }}> or </div>
						<div className={styles.aContainer}>
							<a href="">View Projects</a>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Jumbotron;
